import React from 'react';

class LoginPage extends React.Component {

    render() {
        return (
             <div className="loginpage">
                 <h1>Please login:</h1>
                <form>
                    <label>Email:</label><input type="email"></input>
                    <label>Password:</label><input type="password"></input>
                    <button>Login</button>
                </form>
             </div>
        );
    }
}

export default LoginPage;
